import React ,{Component} from 'react'
import Button from './Button'



class App extends Component{
  constructor(){
    super()
    this.state={
      like: 2
    }
  }

  clkhandler(){
    this.setState({
      like:!this.state.like
    })
    console.log('clkhandler run');
  }

  render(){
    var arr = [1,2,3,4,5,5,6,7,8]
    return(

      <div style={this.state.like?{color:'red'}:{color:'black'}} onClick = {()=>this.clkhandler()}>
        js:{this.state.like?'真':'假'}
        this is app
        <Button/>
        {
          arr.map(
            (k,v)=>{
              return <li>{v}</li>
            }
          )
        }
      </div>
    )
  }
}

export default App;
